    <desc lang="en">Renovation contractor KWAN KA-ON (Miu Kiu Wai) is the elder of four siblings, while his wife SZE LONG-KIU (Sonija Kwok) is a typical housewife. Buying a house is their longtime dream. But when his eldest brother, KWAN KA-HONG's business goes under, they shelve their plan to help him overcome his difficulties. KIU has to look for a job too. Unwilling to see ON shoulder the burden on his own, KWAN KA-LOK (Linda Chung), the third of the siblings, turns to her supervisor GAO WANG-CHIM (Michael Tse) for assistance, resulting in her taking part in an indecent proposal. Her boyfriend, TING KOON-FUNG (Ron Ng), breaks up angrily with her when he finds out about their affair. KWAN KA-WING (Him Law), the youngest of the four, prefers spending to saving and decides that he will in no circumstances help in the service of the mortgage. The family dream of buying a house turns out eventually to be a nightmare that never ends.</desc>
