    <desc lang="en">HONG SHIU LUNG (KOO TIN LOK, LOUIS) is an secret agent in the 21st Century. He joins a pilot programme to fly back in time hoping that he will salvage his unforgettable love. However, something goes wrong during the mission. He is sent back to the Warring States Period. Emperor QI (LAM RAYMOND) has not been crowned yet and is kept hostage in Chiu. In order to return to the future, LUNG decides to help QI become emperor. With his wisdom and Kungfu, he is recognized and given important tasks. A modern man in the wrong era, he is bound to face difficulties. Before QI becomes emperor, LUNG is poisoned, attacked and seduced. He even gets involved in political wars. He was born a romantic man, and even though he is in a totally different time and space, he still manages to get into a love rectangle with a princess, an intellectual and a tycoon's daughter.</desc>
